import React from 'react';
import {Link} from "react-router-dom";
import {getFullName} from "../../../../Common Functions/PersonFunctions";

const PatientBio = ({patient}) => {
    console.log("patient bio",patient);
    const {
        id,
        person: {personName: name, mobileNumber, village, dateOfBirth, gender},
    } = patient;


    return (
        <div className={'person-bio-wrapper'}>

            <div className="person-name-date">
                <h3 className={'fullName'}>{getFullName(name)}</h3>
                <h6 className={'date-of-birth'}>{dateOfBirth}</h6>
            </div>


            <div className={'edit-buttons'}>
                <Link to={'#'}>Edit</Link>
                <Link to={'#'}>Delete</Link>
            </div>

            <div className={'details'}>

                <div className={'line'}>

                    <h5>Age</h5>
                    <h5>22</h5>
                </div>
                <div className={'line'}>

                    <h5>Age</h5>
                    <h5>2232</h5>
                </div>
                <div className={'line'}>

                    <h5>Age</h5>
                    <h5>22</h5>
                </div>
                <div className={'line'}>

                    <h5>Age</h5>
                    <h5>2111112</h5>
                </div>
                <div className={'line'}>

                    <h5>Age</h5>
                    <h5>22</h5>
                </div>


            </div>
            {/*details*/}

            <div className={'allergies'}>

            </div>

        </div>
    );
};

export default PatientBio;
